import jsPDF from "jspdf";

export const feedbackPDF = pdfData => {
  const doc = new jsPDF();

  doc.addFileToVFS(
    "Roboto.ttf",
    ""
  );
  //////////// Header ////////////
  doc.addFont("Roboto.ttf", "Roboto", "normal");
  doc.setFont("Roboto"); // set font
  doc.setFontSize(22);
  doc.text(85, 20, "Feedback");
  doc.setFontSize(16);
  doc.text(20, 35, `Utisak: ${pdfData.score}`);
  doc.setFontSize(16);
  doc.text(150, 35, `${pdfData.date.split("T")[0]}`);

  //////////// Feedback Area ////////////
  // Create multiline text by spliting feedback
  const splitText = doc.splitTextToSize(`${pdfData.feedback}`, 180);
  let y = 60;
  for (let i = 0; i < splitText.length; i++) {
    // If text is longer then 280 add a new page
    if (y > 280) {
      y = 20;
      doc.addPage();
    }
    doc.text(15, y, splitText[i]);
    y = y + 7;
  }
  //////////// Komentar Prodavca ////////////
  doc.setFontSize(10);
  const linea =
    "_______________________________________________________________________________________________________________";
  if (y > 250) {
    y = 20;
    doc.addPage();
    doc.setFontSize(16);
    doc.text(15, y, `Komentar prodavca:`);
    doc.setFontSize(10);
    doc.text(15, y + 10, linea);
    doc.text(15, y + 20, linea);
    doc.text(15, y + 30, linea);
    doc.text(15, y + 40, linea);
    doc.text(150, y + 50, "__________________");
    doc.text(150, y + 60, `datum komentara`);
  } else {
    doc.setFontSize(16);
    doc.text(15, y + 10, `Komentar prodavca:`);
    doc.setFontSize(10);
    doc.text(15, y + 20, linea);
    doc.text(15, y + 30, linea);
    doc.text(15, y + 40, linea);
    doc.text(15, y + 50, linea);
    doc.text(150, y + 60, "___________________________");
    doc.text(157, y + 67, `datum komentara`);
  }

  if (y + 50 > 270) {
    doc.addPage();
  }

  //////////// Footer ////////////
  // Get number of pages in this pdf
  const pageCount = doc.internal.getNumberOfPages();
  // We loop through all pages
  for (let i = 0; i < pageCount; i++) {
    // If the current page is also the last page print signatures
    if (doc.internal.getCurrentPageInfo().pageNumber === pageCount) {
      doc.setFontSize(12);
      doc.text(20, 283, "__________________");
      doc.text(20, 290, `${pdfData.evaluator}`);
      doc.text(100, 290, `${doc.internal.getCurrentPageInfo().pageNumber}`);
      doc.text(150, 283, "__________________");
      doc.text(150, 290, `${pdfData.user}`);
    }
  }
  doc.save(`Feedback-${pdfData.user}-${pdfData.date.split("T")[0]}.pdf`);
};
